import React from 'react';
import {Image} from 'semantic-ui-react';


const ImageOfRolePlayers = () => {
    return (
        <React.Fragment>
            <Image circular src='https://react.semantic-ui.com/images/avatar/small/elliot.jpg' />
           
        </React.Fragment>
    )
}

export default ImageOfRolePlayers;
